} Similar to acceptGame, validation is performed and the move of their opponent is first locally recorded. The game identifier for lookup The caller is the player for this game The opponent event corresponds to the same game Ordering is enforced by ensuring that the supplied event is always forward progressing. (uint256 chainId, uint256 gameId,, uint8 oppX, uint8 oppY) = abi.decode(_movePlayedData[32:], (uint256, uint256, address, uint8, uint8)); // Game was instantiated for this player & the move is for the same game
Game storage game = games[chainId][gameId][msg.sender];
if (game.player != msg.sender) revert GameNotExists();
if (game.gameId != gameId) revert GameNotExists(); // The move played event is forward progressing from the last observed event
if (_movePlayedId.chainId != game.lastOpponentId.chainId) revert IdChainMismatch();
if (_movePlayedId.blockNumber <= game.lastOpponentId.blockNumber) revert MoveNotForwardProgressing();
game.lastOpponentId = _movePlayedId; // Mark the opponents move
game.moves[oppX][oppY] = 2;
game.movesLeft--; When a move is played we check if the game has been drawn or won, determining the subsequent event to emit. The makeMove function is only callable when an opponent has a new MovePlayed event. Therefore, if the game is won or drawn, it cannot be progressed any further by the opponent. // Make the players move
game.moves[_x][_y] = 1;
game.movesLeft--; // Determine the status of the game
if (_isGameWon(game)) { emit GameWon(chainId, gameId, game.player, _x, _y);
} else if (game.movesLeft == 0) { emit GameDraw(chainId, gameId, game.player, _x, _y);
} else { emit MovePlayed(chainId, gameId, game.player, _x, _y);
}

